import React from "react";
import { Link } from "react-router-dom";

const NotFound = (props) => {
  return (
    <Link className="cartoon-link" to={`/cartoon/${props.cartoon.id}`}>
      <li className="cartoon-list-each"></li>
    </Link>
  );
};

export default NotFound;
